INSERT INTO `ps_product_lang` VALUES (1023,1,1,'Najwyższej jakości w 100% plastikowe karty Piatnika. Można nimi grać latami.Czarne, tradycyjne pudełko zawiera talię 55 kart o wymiarach 58x89 mm.Jakość i tradycja! Wiedeńska fabryka Ferd. Piatnik &amp; Sohne istnieje od 1824 roku.Każda talia zawiera 55 kart ze standardowym indeksem w każdym z narożników.Rewersy talii w kolorze czerownym i niebieskim.','Talia kart Piatnik 1364100% Plastik','piatnik-100-plastik-4-indeksy','','','','Piatnik 100% Plastik - 4 indeksy','','','',''),(1024,1,1,'Karty dostępne z czerwonym lub niebieskim rewersie.2 duże indeksy (JUMBO) na przeciwległych narożnikach karty.52 karty + 2 jokery wykonane w 100% z PLASTIKU.Rozmiar pokerowy (63 x 89 mm).Wyprodukowane we Włoszech przez Modiano.Karty są bardzo trwałe - wykonane z mocnego plastiku. Ciężko znaleźć karty o zbliżonej gramaturze. Są bardzo wytrzymałe, odporne na ścieranie, zginanie i zalania.MARKA MODIANO jest liderem w produkcji kart we Włoszech.Talie Modiano używane są w kasynach na całym świecie.','100% plastikowe karty do gry włoskiego lidera w produkcji kart.','modiano-bike-jumbo-plastikowe','','','','Modiano Bike JUMBO PLASTIKOWE','','','',''),(1025,1,1,'Rewelacyjne 100% plastikowe karty do gry w wymiarze pokerowym,Talia zawiera 55 kart o wymiarach 63 x 88 mm - indeksy na czterech rogach.Każda karta zbudowana z 4 warstw(PCV - plastik, warstwa nadrukonośna oraz 2 warstwy lakieru specjalnej formuły)gwarantuje wytrzymałość i zapewnia najlepsze doznania podczas gry.Marka NH FOURNIER  istnieje na rynku od 1868 roku.Karty Fournier kontrolowane są 12 krotnie w toku produkcji.Dzięki temu żadna karta nie posiada defektów a każda talia jest perfekcyjna.Karty Fournier opierają się nieokreślonej ilości odkształceń (np. poprzez wyginanie) i zawsze wracają do swojego pierwotnego kształtu.Nie zużywają się jak zwykłe karty.Pokryte są specjalną warstwą lakieru, która zapewnia niespotykaną gładkość i przyjemność w dotyku. Są odporne na wilgoć, odporne na rozdzieranie, nieprzeźroczyste, nie ulegają wyblaknięciu.Każda talia jest zafoliowana oraz sygnowana hologramowym paskiem ochronnym potwierdzającym oryginalność produktu.','Fournier 2500 100% plastik4 indeksy','fournier-4-indeksy-100-plastik','','','','Fournier 4 indeksy 100% plastik','','','',''),(1026,1,1,'Najwyższej jakości w 100% plastikowe karty Piatnika. Można nimi grać latami.Czarne, tradycyjne pudełko zawiera 2  talie 55 kart o wymiarach 58x89 mm.Jakość i tradycja! Wiedeńska fabryka Ferd. Piatnik &amp; Sohne istnieje od 1824 roku.Każda talia zawiera 55 kart ze standardowym indeksem (regular)Rewersy talii w kolorze czerownym i niebieskim.','Komplet dwóch talii Piatnik 100% plastikowych','piatnik-2-talie-100-plastik','','','','Piatnik 2 talie 100% Plastik','','','',''),(1027,1,1,'Karty KEM są uważane za najlepsze karty na świecie.Wykonane w 100% zoctanu celulozy- najbardziej wytrzymałego tworzywa sztucznego stosowanego w produkcji kart do gry. Dzięki temu nie zdzierają się, są odporne na złamania, znakowanie oraz całkowicie zmywalne. Są dużo trwalsze niż karty plastikowe oferowane przez innych producentów.Najwyższa jakość, wytrzymałość, a co za tym idzie długość użytkowania, są synonimem marki KEM.Komplet zawiera talię w kolorze rewersu czerwonym i niebieskim.JUMBO Indeks na przeciwległych narożnikach karty.Są bezwonne, odporne na ścieranie i łamanie, nie zniekształcają się. Kartami KEM można grać latami.','Najbardziej ekskluzywne karty do gry na świecie !','kem-poker-jumbo-arrow-redblue','','','','KEM poker JUMBO Arrow RED/BLUE','','','',''),(1028,1,1,'Karty Bicycle® PRESTIGE JUMBO Index RIDER BACKKarty  opierają się nieokreślonej ilości odkształceń (np. poprzez wyginanie) i zawsze wracają do swojego pierwotnego kształtu.Nie zużywają się jak zwykłe karty.Pokryte są specjalną warstwą lakieru, która zapewnia niespotykaną gładkość i przyjemność w dotyku.Są odporne na wilgoć, odporne na rozdzieranie, nieprzeźroczyste, nie ulegają wyblaknięciu','Karty Bicycle® PRESTIGE JUMBO Index RIDER BACK Najsłynniejsze karty świata w końcu w wersji 100% plastikowej. Rozmiar pokerowy ( 63 mm x 88 mm) kolor Red lub Blue JUMBO Indeks na przeciwległych rogach awersu.','bicycle-prestige-100-plastik','','','','Bicycle Prestige 100% PLASTIK','','','',''),(1029,1,1,'Talia 100% Plastikowych kart z dużym indeksem.Wykonane z najwyżej jakości materiału, odporne na zalania, przedarcia, zaginanie.Standardowa talia 54 karty.','Piatnik 1361 JUMBO Poker','piatnik-jumbo-100-plastik','','','','Piatnik JUMBO 100% Plastik','','','',''),(1030,1,1,'Najwyższej jakości w 100% plastikowe karty Piatnika. Można nimi grać latami.Czarne, tradycyjne pudełko zawiera talię 55 kart o wymiarach 58x89 mm.Jakość i tradycja! Wiedeńska fabryka Ferd. Piatnik &amp; Sohne istnieje od 1824 roku.Każda talia zawiera 55 kart z powiększonym indeksem (JUMBO).Rewersy talii w kolorze czerownym i niebieskim.','Talia kart Piatnik 1464100% Plastik','piatnik-100-plastik-jumbo','','','','Piatnik 100% Plastik - JUMBO','','','',''),(1031,1,1,'World Poker Tour od 2002 roku zbiera przy finałowym stole najlepszych graczy na świecie, aby wyłaniać najlepszych strategów, analityków, poskramiaczy wewnętrznych emocji, słowem- najlepszych pokerzystów.Aby uczcić jedno z największych wydarzeń zielonostołowych na świecie, Fournier- hiszpańska firma należąca do United States Playing Cards Company wypuściła talię, która już z wysokości pudełka mówi, że mamy do czynienia z produktem z najwyższej półki.Złote tło, duża litera A w lewym górnym rogu symbolizjąca indeksy \"jumbo\", na odwrocie wzór koszulek w kolorze niebieskim bądź czerwonym, a wewnątrz pudełka 55 kart w rozmiarze pokerowym, wykonanych z plastiku, co gwarantuje wiele lat intensywnej, efektownej i efektywnej pracy, nawet pod gołym rozpłakanym niebem.','Złoty standard wprost od hiszpańskiego producenta.','fournier-wpt-gold-edition-redblue','','','','Fournier WPT Gold Edition Red/Blue','','','',''),(1032,1,1,'Karty KEM są uważane za najlepsze karty na świecie.Wykonane w 100% zoctanu celulozy- najbardziej wytrzymałego tworzywa sztucznego stosowanego w produkcji kart do gry. Dzięki temu nie zdzierają się, są odporne na złamania, znakowanie oraz całkowicie zmywalne. Są dużo trwalsze niż karty plastikowe oferowane przez innych producentów.Najwyższa jakość, wytrzymałość, a co za tym idzie długość użytkowania, są synonimem marki KEM.Komplet zawiera talię w kolorze rewersu złotym i czarnym.JUMBO Indeks na przeciwległych narożnikach karty.Są bezwonne, odporne na ścieranie i łamanie, nie zniekształcają się. Kartami KEM można grać latami.','Najbardziej ekskluzywne karty do gry na świecie !','kem-poker-jumbo-blackgold','','','','KEM poker JUMBO Black/Gold','','','',''),(1033,1,1,'Dostępne w kolorze srebrno-czarnym i srebrno-czerwonymTalia plastikowych kart w rozmiarze 63 x 89 mmW talii 54 karty z podwójnym, pokerowym indeksem.Idealne zarówno do gry towarzyskiej jak i profesjonalnych rozgrywek.Karty są wykonane z 100% plastiku najwyższej jakości, zmywalne, odporne na ścieranie i zginanie.Każda talia jest zaklejona, zafoliowana oraz sygnowana logiem COPAG co potwierdza ich oryginalność oraz nowość.Zainwestuj w profesjonalne, oryginalne karty do gry. Najważniejszy atrybut każdego pokerowego turnieju!!','COPAG Texas Holdem Poker Peek100% Plastik','copag-texas-holdem-poker-peek','','','','COPAG Texas Holdem Poker Peek','','','',''),(1034,1,1,'Rewelacyjne 100% plastikowe karty do gry w wymiarze pokerowym,Talia zawiera 55 kart o wymiarach 63 x 88Każda karta zbudowana z 4 warstw(PCV - plastik, warstwa nadrukonośna oraz 2 warstwy lakieru specjalnej formuły)gwarantuje wytrzymałość i zapewnia najlepsze doznania podczas gry.Marka NH FOURNIER  istnieje na rynku od 1868 roku.Karty Fournier kontrolowane są 12 krotnie w toku produkcji.Dzięki temu żadna karta nie posiada defektów a każda talia jest perfekcyjna.Karty Fournier opierają się nieokreślonej ilości odkształceń (np. poprzez wyginanie) i zawsze wracają do swojego pierwotnego kształtu.Nie zużywają się jak zwykłe karty.Pokryte są specjalną warstwą lakieru, która zapewnia niespotykaną gładkość i przyjemność w dotyku. Są odporne na wilgoć, odporne na rozdzieranie, nieprzeźroczyste, nie ulegają wyblaknięciu.Każda talia jest zafoliowana oraz sygnowana hologramowym paskiem ochronnym potwierdzającym oryginalność produktu.','Fournier 2800 100% plastik JUMBO','fournier-jumbo-index-100-plastic','','','','Fournier JUMBO Index 100% Plastic','','','',''),(1035,1,1,'Rewelacyjne 100% plastikowe karty do gry w wymiarze pokerowym,Talia zawiera 55 kart o wymiarach 63 x 88 mm - JUMBO IndeksOficjalne kartyWorld Poker Tour.Każda karta zbudowana z 4 warstw (PCV - plastik, warstwa nadrukonośna oraz 2 warstwy lakieru specjalnej formuły) gwarantuje wytrzymałość i zapewnia najlepsze doznania podczas gry.Marka NH FOURNIER  istnieje na rynku od 1868 roku. Jest światowym liderem w produkcji kart dla profesjonalnych kasyn. Kart Fournier używają kasyna w Vegas, Macau, Monte Carlo.Karty Fournier kontrolowane są 12 krotnie w toku produkcji. Dzięki temu żadna karta nie posiada defektów a każda talia jest perfekcyjna.Karty Fournier opierają się nieokreślonej ilości odkształceń (np. poprzez wyginanie) i zawsze wracają do swojego pierwotnego kształtu. Nie zużywają się jak zwykłe karty. Pokryte są specjalną warstwą lakieru, która zapewnia niespotykaną gładkość i przyjemność w dotyku. Są odporne na wilgoć, odporne na rozdzieranie, nieprzeźroczyste, nie ulegają wyblaknięciu.Każda talia jest zafoliowana oraz sygnowana hologramowym paskiem ochronnym potwierdzającym oryginalność produktu.','Fournier World Poker Tour 100% plastik','fournier-wpt-100-plastik','','','','Fournier WPT 100% Plastik','','','',''),(1036,1,1,'Dostępne w kolorze niebieskim i czerwonym.Talia plastikowych kart w rozmiarze 63 x 89 mmW talii 54 karty z dużym Indeksem w każdym z czterech narożników karty.Idealne zarówno do gry towarzyskiej jak i profesjonalnych rozgrywek.Karty są wykonane z 100% plastiku najwyższej jakości, zmywalne, odporne na ścieranie i zginanie.Każda talia jest zaklejona, zafoliowana oraz sygnowana logiem COPAG co potwierdza ich oryginalność oraz nowość.Zainwestuj w profesjonalne, oryginalne karty do gry. Najważniejszy atrybut każdego pokerowego turnieju!!','100% plastikowe karty marki Copag','copag-jumbo-4-index','','','','COPAG JUMBO 4 Index','','','',''),(1037,1,1,'Karty są wykonane z 100% plastiku najwyższej jakości, odporne na ścieranie i zginanie.Najwyższej jakości plastik zapewnia świetny poślizg na pokerowym suknie. .Talia 55 kart w rozmiarze pokerowym ( 63 x 89 mm)Powiększony Indeks ( JUMBO ) na przeciwległym rogach rewersu.dostępne w kolorze czerwonym i niebieskim.','PLASTIKOWE KARTY PROSTU Z POLSKI!','trefl-texas-holdem-100-plastikowe','','','','TREFL TEXAS HOLD\'EM - 100% PLASTIKOWE','','','',''),(1038,1,1,'MODIANO POKER TEXAS HOLDE\'M100% PLASTIKOWE KARTY Z POWIĘKSZONYM INDEKSEMKarty są bardzo grube - wykonane z elastycznego plastiku.Są bardzo wytrzymałe, odporne na ścieranie, zginanie i zalania.* 100% plastikowe karty do gry marki Modiano* Wysoka jakość* Biała krawędź na odwrocie karty* ekstremalnie wytrzymałe* zmywalne* Idealny do pokera i Black Jack\'a* produkowane we Włoszech* 52 karty do gry + 2x Joker (duży, JUMBO Index)Dostępne w 8 kolorach (w trakcie składania zamówienia prosimy o infrmację w formularzu, który kolor Pańśtwo wybierają).','Karty do gry Modiano Texas Holdem 100% Plastik -','modiano-tx-100-plastik','','','','Modiano TX - 100% PLASTIK','','','',''),(1039,1,1,'W karty nie tylko gra się przy filcowym stole, ale również na działce, plaży, ogólnie rzecz biorąc, na świeżym powietrzu. Nie każdy przygotował się na taką ewentualność talią plastikowych copagów, dlatego wszystkich fanów kart papierowych zachęcamy do wyposażenia się w to plastikowe etui na karty. W etui zmieści się każda taliaw rozmiarze pokerowym, jak również wszystkie drobiazgi, których nie chcielibyśmy zgubić podczas wypoczynku na łonie natury. Wykonane z przyja