kań ze znajomymi oraz jako wyjątkowy prezent dla pasjonatów pokera. Zaprojektowany tak, aby każ','','zestaw-do-pokera-premium-500-szt-w-srebrnej-walizce-niskie-nominaly-zetony-14g','','','','Zestaw do Pokera PREMIUM 500 szt w Srebrnej Walizce Niskie nominały Żetony 14g','','','',''),(1057,1,1,'Masz dość bublowskich zestawów do pokera? Trafiłeś w odpowiednie miejsce.Stworzony z myślą o jakości zestaw 500 żetonów o wadze 14 g,z nominałami. Całość zapakowana w wysokiej jakości walizkę w kolorze czarnym.W skład zestawu wchodzi:500 żetonów o masie 14 g w 6 wariantach kolorystycznychwalizka z zaokrąglonymi rantami2 talie kartciężki , profesjonalny dealer buttonkości do grykonfiguracja żetonów:50x 1 - 150x 5 - 100x 25 - 50x 100 - 25x 500 - 25x 1000','','zestaw-do-pokera-pro-prestige-z-nominalami-500-zetonow-14-g-karty-plastik','','','','Zestaw do Pokera PRO PRESTIGE z nominałami - 500 żetonów 14 g, karty plastik','','','',''),(1058,1,1,'Zestaw 500 żetonów do gry w pokera w oryginalnym, obracającym się stojaku!!!W skład zestawu wchodzą:* 500 żetonów w następujących nominałach:1, 2, 5,10, 25, 50, 100, 200, 500,oraz kilka żetonów o nominale 0,5 ( przydatne w trakcie podziału puli :)grubość żetonu 3,4 mm, średnica 40 mm* 2 talie kart 100% plastikowych z indeksem JUMBO marki MODIANO* 5 akrylowych kości do gry* dealer button sygnowany logiem MODIANO* 5 buttonów ( missed blind, little blind, big blind, kill, reserved)* platikowy stojak o wymiarach 35 cm x 35 cm x 15,5 cm','Szukasz markowego zestawu o gry w pokera?Czas zamienić Twój dotychczasowy?Modiano GETTONIERA - 500 żetonów z nominałamikażdy o wadze aż 14 g w oryginalnym, obracającym sięstojaku!','modiano-gettoniera-500-zetonow','','','','Modiano GETTONIERA - 500 żetonów','','','',''),(1059,1,1,'Zestaw 500 żetonów do pokera w czarnej, eleganckiej walizce.Żetony:Żetony o masie 13.5 grama. Wykonane z bardzo wytrzymałego materiału Clay z metalowym insertem wewnątrz. Posiadają charakterystyczny dźwięk użytkowania, niemożliwy do u