ienie żetonów w jednym kolorze to 100 sztuk.','','dice-chips-zetony-115-g','','','','Dice Chips - żetony 11.5 g','','','',''),(1069,1,1,'Żeton posiada charakterystyczny dźwięk niemożliwy do uzyskania w przypadku żetonów o mniejszej wadze.waga: 11.5 gmateriał: ABS (plastik)metalowy insert wewątrzbrak nominałówdostępne w 8 wariantach kolorstycznychidealnie wywarzone, świetna zwartośćgłębokie kolorwy, nieścieralnejakość kasynowa.Naszym zdaniem żetony suited oferują idealne połączenie wysokiej jakości i przystępnej ceny. Ich rozmiar, waga i wykonanie powodują, że poczujesz się w jak w prawdziwym kasynie.','Ten dwukolorowy żeton o wadze 11,5 grama wykonany jest z ABSu oraz posiada metalowy insert w środku.','zetony-do-pokera-115-g','','','','Żetony do pokera 11,5 g.','','','',''),(1070,1,1,'Wysokiej jakości żetony do pokera wykonane z Clay Composit. Jest to mieszkana tworzywa sztucznego oraz gliny ceramicznej Materiał ten jest wybitnie odporny a same żetony są przyjemniejsze w dotyku, wydają specyficzny dzwięk oraz świetnie wykonuje się nimi triki oraz ustawia w \"kominy\".Specyfikacja:waga: 11.5 gmateriał: Clay (glina)metalowy insert wewątrznominały 1,2,5,10,25,50,100,500,1000,5000dostępne w 10 wariantach kolorstycznych.Podana cena dotyczy 1 żetonu.Minimalne zamówienie żetonów w jednym kolorze to 50 sztuk.','','poker-chip','','','','Poker chip','','','',''),(1071,1,1,'To nie jest zwykła autobiografia. To również książka o pokonywaniu przeszkód i wyciąganiu wniosków po własnych błędach. Ponadto znajdziecie tutaj kawał historii WSOP. Phil Hellmuth pisze o wszystkim, co sprawiło, że jest dzisiaj najbardziej utytułowanym pokerzystą na World Series of Poker.Kto sprzątał klatki po małpach? Jak przetrwać utratę bankrolla? Czy wiecie, że był deal w finałowym rozdaniu Main Eventu WSOP w 1989 już po showdownie?Te fakty i całe mnóstwo innych znajdziecie w tej niezwykłej książce.„Czytając tę książkę dowiecie się o tym, jaki jest Phil Hellmuth więcej, niż sugeruje jego przydomek ‚Pokerowy Bachor’. To fascynujące wejście w głąb umysłu jednej z największych gwiazd pokera.Daniel Negreanu – profesjonalny pokerzysta„Mój mąż Dave Goldberg podziwiał Phila nie tylko jako pokerzystę, ale też jako przyjaciela, a ta książka pokazuje dlaczego. Jest zabawna i inspirująca. Znakomicie będzie się ją czytać każdemu, kto chce dowiedzieć się o emocjach i doświadczeniach gracza, który dotarł na sam szczyt. Oferuje lekcje nie tylko dla aspirujących pokerzystów, ale również dla ojców.”Sheryl Sandberg – Dyrektor operacyjny Facebooka i założycielka „Lean In” oraz „Option B”„Trenuję mistrzów, a Phil Hellmuth jest największym mistrzem pokera mającym na koncie czternaście tytułów WSOP. Uwielbiam jego inspirującą historię i podziwiam odwagę oraz determinację, której potrzebował do wejścia na szczyt i pozostania na nim.”Tony Robbins – Guru wśród trenerów motywacyjnych i autor bestsellerów„Phil Hellmuth wie czego potrzeba, żeby zostać mistrzem i utrzymać się na szczycie. Rok po roku nie wychyla się, tylko wygrywa kolejne tytuły. Brawo!”Jim Harbaugh – Trener futbolu amerykańskiego na Uniwersytecie Michigan','Autobiografia najlepszego pokerzysty świata.','poker-brat-pl-phil-hellmuth','','','','Poker Brat PL - Phil Hellmuth','','','',''),(1072,1,1,'','','','','','','','','','',''),(1073,1,1,'„Alex jest bez wątpienia jednym z najlepszych trenerów naszych czasów. Potrafi rozłożyć na czynniki pierwsze wszystkie ręce i strategie graczy, na każdym poziomie pokera.”Faraz Jaka, zawodowy pokerzystaMit pokerowego talentu„Geniusz to wynik 1 procenta natchnienia i 99 procent wypocenia.”Thomas Edison„Mit pokerowego talentu” to niezwykła książka, będąca podsumowaniem pracy słynnego pokerowego trenera Alexa Fitzgeralda z ponad tysiącem uczniów w ciągu 10 lat.Nie ma to nic wspólnego z pokerowym talentem.Jeśli chcesz wyróżniać się na tle innych grając w pokera, musisz kupić tę książkę, nauczyć się metod Alexa i ciężko pracować – ale na pewno nie potrzebujesz talentu. Alex skupia się na zrozumieniu i analizie typowych pokerowych sytuacji, a nie konkretnych rąk. Jako niezwykle doświadczony nauczyciel, swoje pomysły przedstawia prostym i łatwym do zrozumienia językiem.„Mit pokerowego talentu” nauczy cię:• „modelu gry” zbudowanego od zera• zrozumienia każdego pokerowego narzędzia – programów wspierających grę• dlaczego wiele z tego, co doświadczeni gracze myślą, że wiedzą, jest w rzeczywistości nieprawdą','Dlaczego każdy może zostać świetnym pokerzystą.','mit-pokerowego-talentu','','','','Mit pokerowego talentu','','','',''),(1074,1,1,'To już kolejna książka pokerowa Jonathana Little w naszym sklepie. Książkę współtowrzyło 17 innych pokerowych ekspertów:Jonathan Little, Phil Hellmuth, Mike Sexton, Olivier Busquet, Chris Moneymaker, Liv Boeree, Jared Tendler, Ed Miller, Scott Clemens, Bernard Lee, Zachary Elwood, Matt Affleck, Evan Jarvis, Chad Holloway, Will Tipton, Patricia Cardner, Elliot Roe.Ta pokerowa książka podzielona jest na trzy działy. W części pierwszej strategie analizowane są pod kątem tematycznym, jak zrozumienie fundamentów pokera, gra w satelitach, gra w eventach z niskim wpisowym, analizowanie telli jak i wspinanie się na wyższe stawki.– Ewolucja pokera po pokerowym boomie –Chad Holloway– Equity, pozycja i agresja –Evan Jarvis– Strategie w turniejach z niskim wpisowym –Chris Moneymaker– Wspinanie się na wyższe stawki –Ed Miller– Ogólne koncepcje związane z pokerem turniejowym –Scott Clements– Zaawansowane strategie turniejowe –Matt Affleck– Gra w satelitach –Bernard Lee– Zrozumienie telli –Zachary ElwoodCzęść druga to gruntowne rozbicie gry z technicznego punktu widzenia na elementy, takie jak analiza zakresów, gra GTO, strategie na short stacku, value betowanie i gra na finałowych stołach.– Dogłębna analiza zakresów –Alex Fitzgerald– Strategia gry na short stacku –Phil HellmuthiLiv Boeree– Zagrywanie dla wartości –Jonathan Little– Gra na finałowym stole –Jonathan Little– Gra heads-up –Oliver Busquet– Gra optymalna w sensie GTO –Will TiptonKażdy doświadczony pokerzysta potwierdzi, że techniczna strona pokera to tylko połowa sukcesu. Dlatego też trzecia część odnosi się do siły mentalnej, psychologii i rozumienia zjawiska tiltu.– Mentalna siła –Patricia Cardner– Eliminacja tiltu –Jared Tendler– Pokerowa hipnoterapia –Elliot Roe– Świetne zagrania świetnych graczy –Mike Sexton','Jeśli mielibyście przeczytać tylko jedną aktualną książkę o pokerze, to jest właśnie ta pozycja.','doskonalosc-w-no-limit-holdem-jonathan-little-pl','','','','Doskonałość w No-Limit Holdem  – Jonathan Little PL','','','',''),(1075,1,1,'Zastanawiałeś się kiedyś, w jaki sposób najlepsi pokerzyści na świecie z taką łatwością i powodzeniem blefują? Wielu amatorów popełnia wciąż ten sam błąd starając się bezmyślnie ich naśladować. Nie zdają sobie jednak sprawy z tego, kiedy i po co należy blefować. W tej książce światowej klasy profesjonalny gracz, Jonathan Little (ponad 6,3 mln dolarów zarobionych w turniejach na żywo) wyjaśnia, kiedy i jak blefować, żeby zmaksymalizować swoje zyski z pokera.Książka ta wyjaśnia, jak poszerzyć swój zakres rąk i zmusić przeciwników do popełniania kosztownych błędów. W małych i średnich stawkach gier cashowych oraz w turniejach często będziesz grał przeciwko rywalom grającym w prostolinijny sposób, oglądającym flopy z dobrymi rękami i foldującym w obliczu jakiejkolwiek agresji, kiedy nie złapią kontaktu z boardem. Przeciwko takim graczom możesz znacznie poszerzyć zakres rąk po to, aby zagrać agresywnie po flopie.Liczne przykłady – łącznie z grami amatora, który wyszedł ze swojej bezpiecznej strefy, by wypróbować opisane tu strategie – nauczą cię, kiedy powinieneś grać agresywnie i czym powinieneś się wtedy kierować. Każda sytuacja wyjaśniona jest z uwzględnieniem kart, rozmiarów stacków, pozycji oraz twojego postrzegania przeciwników. Nauczysz się stosować opisane tu pojęcia w prawdziwym świecie, co pozwoli ci wygrać więcej pieniędzy przy pokerowych stołach.','','blefy-ksiazka-pl','','','','Blefy - Książka PL','','','',''),(1076,1,1,'Mental Edge pokazuje, że profesjonalistów od całej reszty dzieli prawdziwa przepaść w podejściu do gry i etyce pracy, a także w trybie życia, codziennych nawykach czy stosowanym oprogramowaniu.Książka zagłębia się w każdy możliwy szczegół pokerowego rzemiosła oraz pokazuje, że to właśnie dbałość o szczegóły jest tym, co pozwala najlepszym wygrywać i osiągać przewagę.LESZEK \'LECHRUMSKI\' BADUROWICZ - autorspecjalista oraz trener w dziedzinie psychologii pokera, autor ponad 200 filmów szkoleniowych, twórca licznych opiniotwórczych artykułów branżowych. Doświadczenie zdobywał w największych szkołach pokera na świecie, takich jak Run It Once czy Poker Strategy. Absolwent psychologii sportu na SWPS.W książce poruszone są następujące zagadnienia:profesjonalna praca nad grą,dyscyplina i budowanie skutecznych nawyków,budowanie właściwego nastawienia do gry,ergonomia pracy i wybór właściwego oprogramowaniaefektywna organizacja czasuwyznaczanie celów z uwzględnieniem specyfiki pokerai wiele innych!','Wykorzystanie psychologii i profesjonalnego podejścia w budowaniu trwałejprzewagiw grze.','mental-edge-poker-pl','','','','Mental Edge Poker PL','','','',''),(1077,1,1,'Książka o strategii gry i podejmowaniu prawidłowych decyzji w turniejach pokerowych. Byron Jacobs przedstawia ponad 80 rozdań z turniejów rozgrywanych online ze średnim wpisowym. Następnie przedstawia swój punkt widzenia i powody podejmowania decyzji. Chris Moorman analizuje sytuację i sposób rozegrania, prezentując również własny pomysł na przeprowadzenie tych rozdań.Dzięki takiej strukturze książki możemy poznać sposób myślenia światowej klasy profesjonalisty, który w turniejach pokerowych online jest od lat numerem 1, wygrywając do tej pory ponad 13 milionów dolarów.','Przedmowę do książki napisał słynny Doyle Brunson!','moormans-book-of-poker-pl','','','','Moorman\'s Book of Poker PL','','','',''),(1078,1,1,'Znakomita książka przeznaczona dla graczy cash ze stawek NL200 i wyższych.Gry cashowe na niskich i średnich stawkach oferują niesamowite możliwości… jeśli zasiadasz do nich posiadając odpowiednie umiejętności. Aby wygrywać w dzisiejszym świecie pokera potrzeba pełnego arsenału najnowszych teorii, strategii i taktyk. Wychodząc naprzeciw oczekiwaniom graczy po raz pierwszy w druku pojawia się książka spełniająca te oczekiwania i wyznaczająca szeroką ścieżkę do osiągnięcia sukcesu. Trzech światowej klasy ekspertów – pokerowy autorytet Ed Miller, zawodowy gracz Sunny Mehta i praktykujący teoretyk gry Matt Flynn połączyli swe siły, aby pomóc Tobie rozwinąć skrzydła na stołach pokerowych.Używając przykładów rozdań z prawdziwych sesji książka Small Stakes No-Limit Hold’em PL tłumaczy złożone teorie pokerowe na łatwe do opanowania zasady, niezbędne do tego, aby wygrywać w dzisiejszych grach. Nauczysz się taktyk gry pozwalających zarabiać pieniądze i będziesz w stanie stworzyć własne strategie tak jak robią to najlepsi profesjonalni pokerzyści.Opanuj takie aspekty gry jak:7 łatwych kroków do osiągania sukcesu w grach no-limitPodejmowanie decyzji na podstawie steal equity i showdown equityMiażdżenie sześcioosobowych gier w internecieIzolowanie słabych graczy i radzenie sobie z agresywnymi przeciwnikamiOkreślanie optymalnej kwoty do blefowania i planowanie dużych blefówBalansowanie strategii gry i zwodzenie przeciwników...i wiele więcej!','Small Stakes No-Limit Hold’em PL–Ed Miller, Sunny Mehta, Matt Flynn','small-stakes-no-limit-holdem','','','','Small Stakes No-Limit Hold\'em','','','',''),(1079,1,1,'Każdy, kto choć raz grał w pokera, pamięta swoje pierwsze wygrane rozdanie, rosnący stosik żetonów, czy też emocje towarzyszące przy blefowaniu. Śmiało można powiedzieć, że te wspomnienia nie zawsze były stricte związane z turniejem w kasynie, zaś ze spotkaniem z kumplami w zaciszu własnego mieszkania.Niektórzy sprawiają sobie sukna do położenia na stole, co oczywiście nie jest złym pomysłem, ale teraz w końcu mamy dla was konkret. Własny stół do pokera. Własny w najdokładniejszym tego słowa znaczeniu- w pełni personalizowany, dokładnie taki, o jakim od zawsze marzyłeś.Wykończenie stołów:- blat wykonany z płyty grubości 18mm pokryty 3mm matą i wysokiej jakości suknem- banda tapicerowana tkaniną skóropodobną wypełniona sprężystą gąbką- nogi metalowe odkręcaneCena bazowa, którą widzimy powyżej, dotyczy stołuo wymiarach 200cm x 100cmwraz z metalowymi odkręcanymi nogami. Wysokość nóg wraz z blatem to 76cm. W cenę wliczone jest sukno oraz banda w dowolnym kolorze.Opcje dodatkowe:- zastosowanie mikrofibry, innych materiałów- wykończenie skórą naturalną-banda drewniana wykonana z wytrzymałego drewna dębowego- możliwość wyboru zabarwienia drewna- miejsce dla krupiera- kaseta na żetony- nogi : metalowe, drewniane, fornirowane lub z płyt obitych aksamitemOsoby zainteresowane ofertą prosimy o wcześniejszy kontakt telefoniczny, w celu omówienia szczegółów dotyczących wykończenia stołu bazowego. Wszelkie wyposażenie dodatkowe (np drewniana ramka lub cupholdery) może spowodować wzrost ceny całego zamówienia.','Stwórz swój własny stół do pokera!','personalizowany-stol-do-pokera','','','','Personalizowany stół do pokera','','','',''),(1080,1,1,'Blat pokerowy dla nawet ośmiu graczy do położenia na stole, z wgłebieniami na napoje, wyłożony suknem w kolorze niebieskim lub zielonym.Po rozłożeniu ma wymiary 180cm x 90cm x 5cm, w stanie łożonym ma wymiary 60 cm x 90 cm x 10cm.','Już nie tylko karty na stół','blat-pokerowy-8-stanowisk-niebieski','','','','Blat pokerowy 8 stanowisk- niebieski','','','',''),(1081,1,1,'Mata jest dodatkowo wzmocniona drewnem i obita suknem. Dodatkowo dzięki odpowiedniemu ciężarowi jest bardzo stabilna.  Nadruki wykonane trwale i estetycznie.Przy stole zasiąść może 10 graczy w przypadku pokera lub ośmiu graczy w przypadku Black Jack\'a.Idealny dla domowych rozrywek. Bardzo stabilny.Po złożeniu zajmuje bardzo mało miejsca.długość: 160cmszerokość: 80cmwaga: 10kg','Duża składana mata do gry w pokera lub 