O, specjalizująca się w produkcji kart plastikowych dorzuca do pieca suknem dwa w jednym- z jednej strony mamy nadruk do pokera texas holdem, zaś z drugiej strony mamy nadruk do ruletki. Wymiary sukna to 90cm x 60cm','Dwa sukna w cenie jednego!','sukno-do-ruletki-i-pokera-modiano','','','','Sukno do ruletki i pokera MODIANO','','','',''),(1094,1,1,'Aluminiowna walizka jest ścielona wewnątrz aksamitem oraz dostosowana do przechowania 1000 żetonów. Posiadam 10 kolumn - każda na 100 żetonów. W zestawie również dwie talie kart, dealer button.Posiada rączkę oraz dwa zamki na klucz.','','walizka-na-1000-zetonow','','','','Walizka na 1000 żetonów','','','',''),(1095,1,1,'Komplet 6 buttonów do gry w pokera.','','dealer-buttons','','','','Dealer buttons','','','',''),(1096,1,1,'','','dealer-button','','','','Dealer button','','','',''),(1097,1,1,'Layout może być położony na stole lub do niego umocowany.Na macie oznaczony na biało obszar pola do gry.Wymiary 90 cm x 180 cm.Wykonane z wysokiej jakości materiału, dzięki czemu rozdawane karty idealnie prześlizgują się po nim.','Wykonana z filcu mata do pokera.','layout-poker-texas-holdem','','','','Layout Poker Texas Holdem','','','',''),(1098,1,1,'Wykonana z wysokiej jakości zielonego sukna, od spodu gumowana dzięki czemu idealnie leży na stole.Po prawej stronie w dolnym rogu logo hiszpańskiego producenta.Wymiary 40x50cm.','Mata karciana marki NH Fournier.','mata-fournier','','','','Mata Fournier','','','',''),(1099,1,1,'But do kart wykonany z plastiku. Pomaga utrzymać potasowane talie w należytym porządku, ułatwia sprawne rozdawanie. Nadaje się do wszystkich gier karcianych bazujących na standardowym lub pokerowym rozmiarze kart. Dodatkowo to urządzenie potasuje za ciebie 2 talie kart. Po włożeniu podzielonej na dwie części talii (lub dwóch) po obu stronach wlotów następuje tasowanie. Potasowane karty pojawiają się w trzecim wylocie, a praktyczna tacka ułatwia odbieranie potasowanych kart.Urządzenie wymaga 4 baterii 1,5 V typu AA (paluszków), które nie są dołączone do zestawu.Idealny dla graczy poszukujących pokerowych akcesoriów najwyższej jakości.','Automatyczny podajnik i tasownik marki Piatnik.2 in 1.','card-shuetasownik-piatnik','','','','Card Shue/Tasownik Piatnik','','','',''),(1100,1,1,'Efektowna skrzynka do przechowywania dwóch talii.Lakierowana. Wewnątrz ścielona czerwonym suknem.Idealny prezent dla pasjonatów kart.Cena przedmiotu nie obejmuje widocznych za zdjeciu kart.','Ręcznie robiona karciarka na dwie talie.','karciarka-blue-2-talie','','','','Karciarka BLUE - 2 talie','','','',''),(1101,1,1,'','Popielniczka KING','poplniczka-king','','','','Poplniczka KING','','','',''),(1102,1,1,'Aluminiowany brelok dla miłośnikó pokera.Zapakowany w efektowne pudełko.','','brelok-pokerowy','','','','Brelok pokerowy','','','',''),(1103,1,1,'Skoro wykosztowałeś się na rewelacyjną talię, to dlaczego by o nią nie zadbać? Zwłaszcza, kiedy nad filcowym stołem również i z twojej przyczyny unosi się dym. Wykonany ze skóry ekologicznej pokrowiec zapewni bezpieczne i efektowne schronienie każdej talii w rozmiarze pokerowym i brydżowym. Idealny na prezent wraz z talią artisanów, która dostępna jest w naszej kolekcji.','Każdy sportowiec nosi pokrowiec.','skorzane-etui-na-karty','','','','Skórzane etui na karty','','','',''),(1104,1,1,'Dostępna w kolorze szarym. Unisex.Rozmiar L ( 174 - 182 cm wzrostu)','Wysokiej jakości bluza Final Table.','bluza-final-table-unisex','','','','Bluza Final Table - Unisex','','','',''),(1105,1,1,'Bluza męska z kapturem zapinana na zamek, z dodanymi nowoczesnymi, modnymi elementami. Šciągany kaptur z podszewką o ozdobnym kroju. ozdobne wzmacniające łaty na łokciach. Dwie przednie kieszenie typu „kangurki”80% bawełna, 20% poliester, SJ czesana po wewnętrznej stronie, 320 g/m2.Dostępna w rozmiarze L i kolorze szarym..','Wysokiej jakości bluza sygnowa logiem Final Table.','final-table-malfini','','','','Final Table - Malfini','','','',''),(1106,1,1,'Dostępna w kolorze czerwonym i szarym.Rozmiar L ( 174 - 182 cm wzrostu)','Wysokiej jakości bluza Final Table.','bluza-final-table','','','','Bluza Final Table','','','',''),(1107,1,1,'UWAGA! Ostatnie zdjęcie przedstawiam karciarki personalizowne, na specjalne zamówienie. Standardowy produkt nie posiada żadnych nadruków.Ręcznie wykonana, lakierowana. Wewnątrz ścielona czerwonym suknem.Efektowna skrzynka do przechowywania dwóch talii kart.Idealny prezent dla pasjonatów kart.Cena przedmiotu nie obejmuje widocznych za zdjeciu kart.','Dostępna w kolorze białym, czarnym i naturalnego drewna.','karciarka-premium-3-kolory','','','','Karciarka PREMIUM - 3 kolory','','','',''),(1108,1,1,'Wykonana w stylu góralskim idealnie przechowuje rozpieczętowane talie.','Ręcznie robiona karciarka na dwie talie.','2-talie-karciarka-filipek','','','','2 Talie - Karciarka Filipek','','','',''),(1109,1,1,'Idealna nagroda dla zwycięzcy pokerowej rozgrywki!wysokość: 20 cmkolor: odcień brązuProdukt zapakowany w karton oraz ochronną formę styropianową. Nie uszkodzi się w trakcie transportu.Przy podstawie miejsce na naklejkę okolicznościową.','Statuetka poker/brydż','statuetka-king','','','','Statuetka KING','','','',''),(1110,1,1,'Idealna nagroda dla zwycięzcy pokerowej rozgrywki!wysokość: 12 cmkolor: odcień brązuProdukt zapakowany w karton oraz ochronną formę styropianową. Nie uszkodzi się w trakcie transportu.Przy podstawie miejsce na naklejkę okolicznościową.','Statuetka pokerowa - DONK','stauetka-donk','','','','Stauetka DONK','','','',''),(1111,1,1,'Statuetka plastikowa na postumencie kamiennym- ręka z 4 asami.Wysokość 13 cmPodstawa 6x6 cmIdealna jako nagroda w turniejach, zarówno tych profesjonalnych jak i tych rozgrywanych w domowym zaciszu.Każda statuetka zapakowana w kartonik oraz owinięta ochronnym materiałem.','statuetka pokerowa GOLD','statuetka-gold','','','','Statuetka GOLD','','','',''),(1112,1,1,'figurka żywiczna pokryta farbą.Wysokość: 16 cmPrzy podstawie miejsce na naklejkę okolicznościową.Produkt zapakowany w karton oraz ochronną formę styropianową. Nie uszkodzi się w trakcie transportu.','Statuetka NUTS','statuetka-nuts','','','','Statuetka NUTS','','','',''),(1113,1,1,'Idealna jako nagroda w turniejach, zarówno tych profesjonalnych jak i tych rozgrywanych w domowym zaciszu.Wykonane z żywicy i metalicznego odlewu trofeum przedstawia dłoń trzymającą 5 kart. Posiada również wolne miejsce w podstawie na przyklejenie danych turnieju/zwycięzcy.Każda statuetka zapakowana w kartonik oraz owinięta ochronnym materiałem.Dostępna jedynie w jednym odcieniu.Wymiar: 11.5*5*5cmDostępna w 3 wariwantach kolorystycznych.','','statuetka-poker','','','','Statuetka POKER','','','',''),(1114,1,1,'Idealna nagroda dla zwycięzcy pokerowej rozgrywki!wysokość: 15 cmkolor: odcień brązuProdukt zapakowany w karton oraz ochronną formę styropianową. Nie uszkodzi się w trakcie transportu.Przy podstawie miejsce na naklejkę okolicznościową.','Statuetka CARDS','statuetka-cards','','','','Statuetka CARDS','','','',''),(1115,1,1,'Tylko karty Bicycle ProPeek posiadają podwójny indeks, dzięki któremu sprawdzenie \"rozdanej ręki\" wymaga minimalnego odgięcia kart.Powozuje to, że karty z biegiem czasu nie ulegają nieodwracalnym zniszczeniom i odkształceniom.Bicycle ProPeek Poker - amerykańskie firmy USPC Co.Wykonane metodą Air Cushion Finish.Talia zawiera 55 kart ( 52 + 2 jokery + info card)Karty nowe, zafoliowne.','Podwójny Indeks !','bicycle-propeek-poker','','','','Bicycle ProPeek Poker','','','',''),(1116,1,1,'Oficjalny produkt sygnowny logiem WSOP wyprodukowany przez USPC Co,Talia 55 kart w rozmiarze pokerowym 63 x 89mm(52 + 2 jokery + info card)Standard indeks na przeciwległych rogach awersu.Talia nowa, zapakowana, sygnowana logiem Bicycle.Dostępna w kolorze czerwonym i czarnym.','Talia kart Bicycle World Series of Poker','bicycle-wsop','','','','Bicycle WSOP','','','',''),(1117,1,1,'Unikalna talia 55 kart w rozmiarze pokerowym 63 x 89 mm(52 + 2 jokery + info card)Standardowy indeks na przeciwległych rogach awersu.Talia nowa, zapakowana, sygnowana logiem Bicycle.Talia ta powstała przy współpracy z grupąTheory11 - mistrzów Cardistry.','Karty Bicycle Guardians','guardians-bicycle','','','','Guardians - Bicycle','','','',''),(1118,1,1,'Bicycle Standard Rider BackSą to najbardziej popularne karty na świecie!Karty Bicycle Standard Rider Back są idealne zarówno do pokera, magicznych sztuczek jak i pozostałych gier.Tradycja sięgająca 1885 r. oraz zdobyta reputacja sprawiają, że karty Bicycle są najbardziej rozpoznawalnymi oraz cieszącymi się najlepszą opinią kartami na całym świecie!!Każda talia wykonana jest z własnego, unikatowego papieru oraz powlekana specjalistycznym tworzywem. Dzięki temu klienci od wielu lat ufają produktom Bicycle.Wyłączną cechą karty Bicycle jest wykończenie kart metodą „Air Cushion”. Ta sekretna formuła sprawia, że karty Bicycle mają dłuższą żywotność, łatwiej się je tasuje, rozdaje co znacznie uprzyjemnia karcianą rozgrywkę!','Talia 55 kart w rozmiarze pokerowym 63 x 89mm (52 + 2 jokery + info card) Standardowy indeks na przeciwległych rogach awersu. Talia nowa, zapakowana, sygnowana logiem Bicycle. Dostępne w kolorze czerwonym i niebieskim.','bicycle-standard-rider-back','','','','Bicycle Standard Rider Back','','','',''),(1119,1,1,'Idealna do wszelkiego rodzaju rozgrywek karcianych oraz dla kolekcjonerów.Talia kart światowego lidera w produkcji kart dla kasyn- hiszpańskiego NH Fournier.Świadczy to o wybitnej jakości tych kart.Każda talia zapakowana w ochronne, plastikowe pudełko.Karty w rozmiarze pokerowym 63 mm x 88 mm.Charakterystyczny czerwony rewers z czarnym bykiem.','Toro Poker Deck by FournierTalia standardowa. 52 karty + 2 jokery.','fournier-toro-poker','','','','Fournier Toro Poker','','','',''),(1120,1,1,'Talia 55 kart kart ze standardowym indeksem używana w wielu kasynach w Europie. Karty papierowe z fakturą liniową powlekane plastikiem. Każda karta zbudowana jest z 5 warstw gwarantuje wytrzymałość i zapewnia najlepsze doznania podczas gry. Marka istniejąca na rynku od 1868 roku. Karty Fourniera kontrolowane są 12-krotnie w toku produkcji. Żadna talia nie posiada defektów ani żadnych znaków dyskwalifikujących talię z profesjonalnej gry. Jedyny w swoim rodzaju system przycinania i komputerowa kontrola tego procesu gwarantują, że karty te mają identyczny rozmiar – złożona talia tworzy jeden zwarty blok papierowy.Zafunduj sobie najwyższą jakość!Pokrycie specjalną formułą lakieru zapewnia niespotykaną gładkość i przyjemność w dotyku. Pozostałe zalety tych kart to: odporność na wilgoć, wewnętrzna spójność – większa odporność na rozdzieranie, nieprzeźroczystość, odporność kolorów na wyblaknięcie i używanie. Marka Fournier pokazuje jak wieloma istotnymi szczegółami może różnić się tak prosta z pozoru rzecz jaką jest karta do gry...Standardowy Indeks na przeciwległych narożnikach karty. Dostępne w kolorze czerwonym i niebieskim.','','fournier-18-standard-poker','','','','Fournier  18 Standard Poker','','','',''),(1121,1,1,'Wykonany z wyoskiej jakości akrylu marker do oznaczania lokalizacji numeru w ruletce.Dostępny w kolorze czerwonym i niebieskim.Wysokość 7 cm.','','marker-do-ruletki','','','','Marker do ruletki','','','','');
